ks.x:
var $bm_rt;
var n, n, p0, p1, p, pCur, t, freq, decay, amplitude, m, i, v;
$bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time)
        n--;
}
if (n > 0) {
    p0 = thisProperty.points($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
    p1 = thisProperty.points(key(n).time);
    p = [];
    pCur = thisProperty.points();
    t = $bm_sub(time, key(n).time);
    freq = 1;
    decay = 3;
    amplitude = 1;
    m = $bm_div($bm_mul(amplitude, Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul(decay, t)));
    for (i = 0; i < p0.length; i++) {
        v = $bm_mul($bm_mul($bm_sub(p1[i], p0[i]), 10), m);
        p.push($bm_sum(pCur[i], v));
    }
    $bm_rt = createPath(p, thisProperty.inTangents(), thisProperty.outTangents(), thisProperty.isClosed());
} else
    $bm_rt = value;

